webpackJsonp([0x8f365ee42380],{1038:function(t,e){t.exports={data:{allPostTitles:{edges:[{node:{frontmatter:{title:"Contributing",group:"Internals",type:"doc"},fields:{slug:"/contributing"}}},{node:{frontmatter:{title:"Create a New Admin User",group:"Advanced Usage",type:"doc"},fields:{slug:"/create-a-new-admin-user"}}},{node:{frontmatter:{title:"Get Started",group:"Basic Usage",type:"doc"},fields:{slug:"/get-started"}}},{node:{frontmatter:{title:"Set up Custom Domain",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-custom-domain"}}},{node:{frontmatter:{title:"Cost Estimate",group:"Internals",type:"doc"},fields:{slug:"/cost-estimate"}}},{node:{frontmatter:{title:"Set up Custom HTTP(S) Monitoring",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-custom-http-s-monitoring"}}},{node:{frontmatter:{title:"Set up the development environment",group:"Internals",type:"doc"},fields:{slug:"/set-up-the-development-environment"}}},{node:{frontmatter:{title:"Integrate with Other Monitoring Systems",group:"Advanced Usage",type:"doc"},fields:{slug:"/integrate-with-other-monitoring-systems"}}},{node:{frontmatter:{title:"Supported AWS Regions",group:"Basic Usage",type:"doc"},fields:{slug:"/supported-aws-regions"}}},{node:{frontmatter:{title:"Upgrading LambStatus",group:"Basic Usage",type:"doc"},fields:{slug:"/upgrading-lamb-status"}}},{node:{frontmatter:{title:"Set up Email Notification",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-email-notification"}}}]},postBySlug:{html:'<p>By default, the status page has the url like \'abcdefghi.cloudfront.net\'. The steps below explain how to set up your custom domain.</p>\n<p><em>Note: you don\'t need to do that on creating a new stack. You can do it later.</em></p>\n<h3 id="prerequisite"><a href="#prerequisite" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Prerequisite</h3>\n<ul>\n<li>A SSL/TLS certificate for your custom domain, managed by AWS Certificate Manager (ACM)</li>\n</ul>\n<p>   Due to <a href="http://docs.aws.amazon.com/AmazonCloudFront/latest/DeveloperGuide/cnames-and-https-requirements.html#https-requirements-aws-region">the limitation of the AWS</a>, you must have the certificate in <strong>the US East (N. Virginia) region</strong>. See <a href="http://docs.aws.amazon.com/acm/latest/userguide/import-certificate.html">this page</a> to import your certificate into ACM, or you may <a href="http://docs.aws.amazon.com/acm/latest/userguide/gs-acm-request.html">request a new one</a></p>\n<h3 id="set-up"><a href="#set-up" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Set up</h3>\n<p>You need to update your LambStatus stack first. Then, configure the DNS service.</p>\n<ol>\n<li>Open <a href="https://console.aws.amazon.com/cloudformation">the CloudFormation console</a> and update your LambStatus stack. On updating, specify <code>StatusPageSSLCertificate</code> and <code>StatusPageURL</code> parameters.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.44473342002601%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="CustomDomain1"\n        title=""\n        src="/LambStatus-website/static/CustomDomain1-2e693b09a88b34aff826f3390ff10735-ffc88.png"\n        srcset="/LambStatus-website/static/CustomDomain1-2e693b09a88b34aff826f3390ff10735-d16f8.png 198w,/LambStatus-website/static/CustomDomain1-2e693b09a88b34aff826f3390ff10735-f21b1.png 395w,/LambStatus-website/static/CustomDomain1-2e693b09a88b34aff826f3390ff10735-ffc88.png 790w,/LambStatus-website/static/CustomDomain1-2e693b09a88b34aff826f3390ff10735-81e7e.png 1185w,/LambStatus-website/static/CustomDomain1-2e693b09a88b34aff826f3390ff10735-a0db9.png 1538w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<ul>\n<li><code>StatusPageSSLCertificate</code>: the ARN of an AWS Certificate Manager certificate, such as \'arn:aws:acm:us-east-1:000000000000:certificate/00000000-0000-0000-0000-000000000000\'.</li>\n<li><code>StatusPageURL</code>: the domain name of your status page.</li>\n<li>You may specify <code>AdminPageSSLCertificate</code> and <code>AdminPageURL</code> to change the URL of the admin page.</li>\n</ul>\n<p>This update takes 10-20 minutes since it changes the CloudFront settings.</p>\n<ol start="2">\n<li>Configure the DNS service</li>\n</ol>\n<p>If you\'re using Route53, <a href="http://docs.aws.amazon.com/Route53/latest/DeveloperGuide/routing-to-cloudfront-distribution.html#routing-to-cloudfront-distribution-config">perform the procedures here</a>. If not, add the CNAME record points to your CloudFront domain (e.g. \'abcdefghi.cloudfront.net\') using the method provided by your DNS service provider.</p>',timeToRead:1,excerpt:"By default, the status page has the url like 'abcdefghi.cloudfront.net'. The steps below explain how to set up your custom domain. Note: you…",frontmatter:{title:"Set up Custom Domain"},fields:{slug:"/set-up-custom-domain"}}},pathContext:{slug:"/set-up-custom-domain"}}}});
